    // Por ejemplo, redirigir al usuario a la página de inicio de sesión
  };

  return (
    <div className="container mt-5">
      <div className="row">
        <div className="col-md-6 offset-md-3">
          <div className="card">
            <div className="card-header">
              <h3>Bienvenido al Dashboard de Administrativo</h3>
            </div>
            <div className="card-body">
              <p>¡Hola, usuario! Bienvenido al dashboard de Administrativo.</p>
              {/* Aquí puedes mostrar cualquier otro contenido del dashboard */}
            </div>
            <div className="card-footer text-end">
              <Button variant="primary" onClick={handleLogout}>Cerrar Sesión</Button>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default InvestigadorDashboard;
